import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import styled from 'styled-components';

const HeaderWrapper = styled.header`
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  z-index: 1000;
  background: var(--white);
  box-shadow: var(--shadow-sm);
  animation: fadeInDown 0.6s ease;

  @keyframes fadeInDown {
    from {
      opacity: 0;
      transform: translateY(-30px);
    }
    to {
      opacity: 1;
      transform: translateY(0);
    }
  }
`;

const HeaderTop = styled.div`
  background: var(--gradient-pink);
  color: var(--white);
  padding: 10px 0;
  text-align: center;
  font-size: 0.9rem;
  font-weight: 500;
`;

const Navbar = styled.nav`
  padding: 1rem 0;
`;

const NavContainer = styled.div`
  width: 100%;
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 1rem;
  display: flex;
  align-items: center;
  justify-content: space-between;
`;

const Logo = styled(Link)`
  display: flex;
  align-items: center;
  gap: 12px;
  font-size: 1.5rem;
  font-weight: 700;
  color: var(--primary-pink);

  img {
    width: 40px;
    height: 40px;
    object-fit: contain;
    transition: transform var(--transition-normal);
  }

  &:hover img {
    transform: rotate(360deg) scale(1.1);
  }
`;

const NavMenu = styled.ul`
  display: flex;
  gap: 2rem;

  @media (max-width: 768px) {
    display: ${props => props.$isOpen ? 'flex' : 'none'};
    position: fixed;
    top: 100px;
    left: 0;
    width: 100%;
    height: calc(100vh - 100px);
    background: var(--white);
    flex-direction: column;
    padding: 2rem;
    box-shadow: var(--shadow-lg);
  }
`;

const NavLink = styled(Link)`
  color: var(--primary-black);
  font-weight: 500;
  position: relative;
  padding: 0.5rem 0;

  &::after {
    content: '';
    position: absolute;
    bottom: 0;
    left: 0;
    width: 0;
    height: 2px;
    background: var(--gradient-pink);
    transition: width var(--transition-normal);
  }

  &:hover::after,
  &.active::after {
    width: 100%;
  }
`;

const NavIcons = styled.div`
  display: flex;
  gap: 1rem;
`;

const IconBtn = styled.button`
  width: 42px;
  height: 42px;
  border-radius: 50%;
  display: flex;
  align-items: center;
  justify-content: center;
  background: var(--off-white);
  color: var(--primary-black);
  position: relative;
  transition: all var(--transition-normal);

  &:hover {
    background: var(--gradient-pink);
    color: var(--white);
    transform: translateY(-3px);
    box-shadow: var(--shadow-pink);
  }
`;

const CartBadge = styled.span`
  position: absolute;
  top: -5px;
  right: -5px;
  background: var(--secondary-pink);
  color: var(--white);
  width: 20px;
  height: 20px;
  border-radius: 50%;
  font-size: 0.75rem;
  display: flex;
  align-items: center;
  justify-content: center;
  font-weight: 600;
`;

const MobileToggle = styled.button`
  display: none;
  flex-direction: column;
  gap: 5px;
  background: transparent;

  span {
    width: 25px;
    height: 3px;
    background: var(--primary-pink);
    border-radius: 3px;
    transition: all var(--transition-normal);
  }

  @media (max-width: 768px) {
    display: flex;
  }
`;

const Header = ({ cartCount }) => {
  const [isOpen, setIsOpen] = useState(false);

  return (
    <HeaderWrapper>
      <HeaderTop>
        <div className="container">
          <span>✨ FREE SHIPPING ON ALL ORDERS ✨</span>
        </div>
      </HeaderTop>
      <Navbar>
        <NavContainer>
          <Logo to="/">
            <img src="/Image/Zoies logo.png" alt="Zoie's" />
            <span>Zoe's Accessories</span>
          </Logo>
          
          <MobileToggle onClick={() => setIsOpen(!isOpen)}>
            <span />
            <span />
            <span />
          </MobileToggle>

          <NavMenu $isOpen={isOpen}>
            <li><NavLink to="/" onClick={() => setIsOpen(false)}>Home</NavLink></li>
            <li><NavLink to="/shop" onClick={() => setIsOpen(false)}>Shop</NavLink></li>
            <li><NavLink to="/reviews" onClick={() => setIsOpen(false)}>Reviews</NavLink></li>
            <li><NavLink to="/about" onClick={() => setIsOpen(false)}>About</NavLink></li>
            <li><NavLink to="/contact" onClick={() => setIsOpen(false)}>Contact</NavLink></li>
          </NavMenu>

          <NavIcons>
            <IconBtn title="Search">
              <i className="fas fa-search"></i>
            </IconBtn>
            <IconBtn as={Link} to="/login" title="Account">
              <i className="fas fa-user"></i>
            </IconBtn>
            <IconBtn as={Link} to="/cart" title="Cart">
              <i className="fas fa-shopping-cart"></i>
              {cartCount > 0 && <CartBadge>{cartCount}</CartBadge>}
            </IconBtn>
          </NavIcons>
        </NavContainer>
      </Navbar>
    </HeaderWrapper>
  );
};

export default Header;
